  false,\n\t\"url\": null,\n\t\"notes\": \"This study examines case screening decisions,
  charging decisions, plea offers, sentence recommendations, and dismissals in two
  moderately large county prosecutors' offices. It includes statistical analyses of
  actual case outcomes, responses to a standardized set of hypothetical cases, and
  responses to a survey of prosecutors' opinions and priorities, as well as qualitative
  analyses of two waves of individual interviews and focus groups.\",\n\t\"license_title\":
